	public static int Ladder(int[][] arr) {
		int answer = 0;

		while (x != 0) {
			arr[x][y] = 0;
			if (y > 0 && arr[x][y - 1] == 1) {
				y--;
				// arr[x][y] = 0;
				continue;
			} else if (y + 1 < arr.length && arr[x][y + 1] == 1) {
				y++;
				// arr[x][y] = 0;
				continue;
			} else if (arr[x - 1][y] == 1) {
				x--;
				if (x == 0) {
					answer = y;
					return answer;
				}
				continue;
			}
		}

		return answer;
	}

